import "../Style/Test_Menu.css";
import react, { useState } from "react";

const Test_Menu = () => {
  const [isHovering, setIsHovering] = useState(false);
  const handleMouseOver = () => {
    setIsHovering(true);
  };

  const handleMouseOut = () => {
    setIsHovering(false);
  };
  return (
    <div className="test2">
      <div className="test" onMouseOut={handleMouseOut}>
        <form className="tabmenu_form" onMouseOver={handleMouseOver}>
          <div className="font_size_ul">
            <ul className="ul">기타</ul>
          </div>
          <div className="font_size_ul">
            <ul className="ul">작</ul>
          </div>
          <div className="font_size_ul">
            <ul className="ul">기다란거 테스트</ul>
          </div>
        </form>
        <form className={isHovering ? "topmenu_hover_ul" : "topmenu_ul"}>
          test
        </form>
      </div>
    </div>
  );
};

export default Test_Menu;
